const reducer = (state, action) => {};
const Index = () => {
  let intialState = {
    Add: {
      count: 0,
    },
    Sub: {
      count: 0,
    },
    Mul: {
      count: 0,
    },
    Div: {
      count: 0,
    },
    Mod: {
      count: 0,
    },
  };
  const [state, dispatch] = useReducer(reducer, intialState);
  return (
    <>
      <h1>{state.Add.count}</h1>
      <button>+2</button>
      <h1>{state.Sub.count}</h1>
      <button>-2</button>
    </>
  );
};
export default Index;
